export default function loadBalancer(chinaDownload, USDownload) {
  return Promise.race([chinaDownload, USDownload])
    .then(value => {
      if (value instanceof Error) {
        return Promise.race([chinaDownload, USDownload])
          .then(value => value);
      } else {
        return value;
      }
    });
